INSERT INTO `penerbitan_pn_prodev` (`id`, `naskah_id`, `sistematika`, `nilai_keilmuan`, `kelompok_buku_id`, `isi_materi`, `sasaran_keilmuan`, `sasaran_pasar`, `sumber_dana_pasar`, `skala_penilaian`, `saran`, `potensi`, `usulan_judul`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
('11802d48f45e40c7862e4edc75ef8fd8', 'c2e2e07b34e643aa9ced463832412bf8', 'Baik', 'Baik', 'ffcca04ba0894989b011c72ecf70591e', '\"Whatever you are feeling, God can handle it--all of it. The tears, screams, and questions. God invites you to let Him tend to your heart.\"\r\nBuku ini mengisahkan perjalanan hidup Anne Wilson pasca saudaranya, Jacob, meninggal karena kecelakaan mobil. Ditengah kekalutan hidupnya justru Tuhan memberikan Anne sebuah panggilan hidup yaitu menciptakan sebuah lagu untuk memuliakan nama-Nya. Lagunya yang berjudul My Jesus adalah cerita pribadinya yang bangkit dari keterpurukan karena duka kehilangan, lagu ini membawa pesan penyemangat bagi siapa pun yang merindukan Tuhan untuk menghapus air matanya. Melalui penderitaan kehilangan Tuhan membawa kita semakin dekat kepada Dia yang selalu memberi jalan\r\nPesan yang disampaikan dalam buku dan lagu My Jesus :\r\n• Menunjukkan bagaimana Tuhan dapat membawa tujuan dari kehilangan\r\n• Menawarkan harapan di tengah patah hati\r\n• Mengingatkan Anda bahwa Tuhan tidak pernah meninggalkan Anda\r\n\r\nDaftar Isi:\r\nForeword by Matthew West\r\nChapter 1: Faith Like a Child\r\nChapter 2: Jacob Kent Wilson\r\nChapter 3: June 7, 2017\r\nChapter 4: Choosing to Trust\r\nChapter 5: Offering My Song\r\nChapter 6: Through the Valley\r\nChapter 7: What a Beautiful Name\r\nChapter 8: A God - Sized Dream\r\nChapter 9: Turning Point\r\nChapter 10: The Release\r\nChapter 11: Seasons of Hope\r\nEpilogue: A Final Note from Anne\r\nAcknowledgements\r\nAbout The Author', 'penguatan iman, bangkit dari keterpurukan & kedukaan (grieving)', 'masyarakat umum', NULL, 'Baik', 'Diterima', NULL, NULL, 'ce64659a0f3a4847aa5376ce7ea44afd', NULL, '2023-02-21 09:02:59', NULL),
('13f01028016c4a0b9ec3119527334710', 'eccef6c1228946ccaa74f224ab660a83', 'Cukup', 'Cukup', '47ac055ec3ee4c14829f31781db0d886', 'Buku ini dibuat untuk memenuhi kebutuhan para siswa dan guru akan buku-buku referensi, pendamping, atau pelengkap untuk mendukung kegiatan belajar-mengajar. Buku ini disusun dengan tujuan membantu siswa dalam menguasai kompetensi seperti yang disyaratkan Kurikulum Merdeka.\r\nBuku disusun sudah sangat lengkap, dilengkapi dengan glosarium, daftar pustaka hingga indeks.', 'Siswa kelas II, guru/pendidik', 'Siswa kelas II, guru/pendidik', 'Sekolah, pribadi', 'Cukup', 'Diterima', 'menjawab kebutuhan pasar', NULL, 'da08118037ca462381b126499598d4cd', NULL, '2023-02-08 02:11:11', NULL),
('2b17ac120cd64911b028c72273450c0a', '02097006de4146329307f8c738670310', 'Cukup', 'Cukup', '47ac055ec3ee4c14829f31781db0d886', 'Buku ini dibuat untuk memenuhi kebutuhan para siswa dan guru akan buku-buku referensi, pendamping, atau pelengkap untuk mendukung kegiatan belajar-mengajar. Buku ini disusun dengan tujuan membantu siswa dalam menguasai kompetensi seperti yang disyaratkan Kurikulum Merdeka.\r\nBuku disusun sudah sangat lengkap, dilengkapi dengan glosarium, daftar pustaka hingga indeks.', 'Siswa kelas V, guru/pendidik', 'Siswa kelas V, guru/pendidik', 'Sekolah, pribadi', 'Cukup', 'Diterima', 'menjawab kebutuhan pasar', NULL, 'da08118037ca462381b126499598d4cd', NULL, '2023-02-08 02:11:58', NULL),
('2f2ff51a408a46d38ecb4d7817a96a88', '86baff2eff6e4f4b9d4a25d5a9cb9f0c', 'Cukup', 'Cukup', '47ac055ec3ee4c14829f31781db0d886', 'Buku ini dibuat untuk memenuhi kebutuhan para siswa dan guru akan buku-buku referensi, pendamping, atau pelengkap untuk mendukung kegiatan belajar-mengajar. Buku ini disusun dengan tujuan membantu siswa dalam menguasai kompetensi seperti yang disyaratkan Kurikulum Merdeka.\r\nBuku disusun sudah sangat lengkap, dilengkapi dengan glosarium, daftar pustaka hingga indeks.', 'Siswa kelas VIII SMP/MTs, guru. pendidik', 'Siswa kelas VIII SMP/MTs, guru pendidik', 'Sekolah, pribadi', 'Cukup', 'Diterima', 'menjawab kebutuhan pasar', NULL, 'da08118037ca462381b126499598d4cd', NULL, '2023-02-08 02:34:02', NULL),
('33332c27bdd04596ad7e48cb631acbea', '6f97815309ec4a4282475c6fbe70a975', 'Cukup', 'Cukup', '338668ba6f424786881b6e3db917be71', 'zdfgdbh', 'gdfh ddh', 'agrfge', 'dfga dgd', 'Cukup', 'Ditolak', 'hfxfn', NULL, 'da08118037ca462381b126499598d4cd', NULL, '2023-02-02 02:49:05', NULL),
('5a39d55df8bd4f32a4a54e67864d62a1', '57a17774bc884a9caf3baa777c27c01a', 'Baik', 'Baik', '5614b0b8061b4d1c87ebe91e4f70c35b', 'Penulis Siska Rafika menerjemahkan buku Maximum Teaching and Learning ke dalam bahasa indonesia. Buku tersebut dibuat berdasarkan kondisi yang terjadi di Filipina tahun 2011, dan sudah disesuaikan dengan kondisi di Indonesia tahun 2022. Buku tersebut berisi topik Merdeka Belajar yang telah digaungkan di Indonesia beberapa tahun yang lalu dan juga tipe-tipe pembelajaran oleh murid dan guru, serta karakteristiknya. Tidak hanya murid saja yang harus dikenali gaya belajarnya, guru pun juga harus mengenal gaya mengajarnya.\r\nProses KBM (kegiatan belajar mengajar) yang efektif tidak hanya oleh peran murid dan gurunya saja, melainkan ada faktor lingkungan belajar yang turut memberi peran pada daya serap siswa.\r\n\r\nKeberhasilan proses KBM tidak terlepas dari peran Roh Kudus. Keterbatasan manusia membuat segala upaya tidak mencapai hasil yang maksimal, melainkan dengan melibatkan Roh Kudus dalam proses KBM akan menolong guru dan siswa untuk mencapai hasil yang terbaik. Roh Kudus perlu diundang ke dalam pribadi setiap mereka agar diriNya dapat berkarya. Karya Roh Kudus dalam pribadi guru/siswa lah yang akan membawa transformasi dalam pembelajaran dan pengajaran menjadi maksimal.', 'Guru, Pengembang Kurikulum / Bahan Ajar', 'Masyarakat umum, Guru PAK, Guru sekolah minggu', NULL, 'Baik', 'Diterima', 'Masyarakat umum, Guru PAK, Guru sekolah minggu', NULL, 'ce64659a0f3a4847aa5376ce7ea44afd', NULL, '2023-02-06 09:16:10', NULL),
('78d4940cd7d243a2af17026a408423bc', 'ef8854ee96824f699e67338abcc736cc', 'Cukup', 'Cukup', '47ac055ec3ee4c14829f31781db0d886', 'Buku ini dibuat untuk memenuhi kebutuhan para siswa dan guru akan buku-buku referensi, pendamping, atau pelengkap untuk mendukung kegiatan belajar-mengajar. Buku ini disusun dengan tujuan membantu siswa dalam menguasai kompetensi seperti yang disyaratkan Kurikulum Merdeka.\r\nBuku disusun sudah sangat lengkap, dilengkapi dengan glosarium, daftar pustaka hingga indeks.', 'Siswa kelas II SD/MI, Guru/pendidik', 'Siswa kelas II SD/MI, Guru/pendidik', 'Sekolah, pribadi', 'Cukup', 'Diterima', 'menjawab kebutuhan pasar', NULL, 'da08118037ca462381b126499598d4cd', NULL, '2023-02-08 01:42:26', NULL),
('8812ee51444c489da006756d0199784d', 'f958d01da4a349cdae27653f6917c166', 'Baik', 'Baik', 'ffcca04ba0894989b011c72ecf70591e', 'Buku ini mengisahkan tentang kekuatan doa. Bagaimana Tuhan datang menyertai hidup kita sehari-hari. Dia membawa kita kepada lembah hijau di tengah perjuangan kita menghadapi sakit penyakit, depresi atau kematian, atau hari-hari yang buruk. Buku ini berisikan cerita yang mengingatkan kita kepada Tuhan bahwa Dia melihat dan mempedulikan perjuangan kita; mujizat-Nya yang ajaib dan mulia membuktikan doa bukan sekedar kata-kata, doa adalah tindakan.\r\nBuku ini akan menyadarkan pembacanya bahwa seperti Harris (penulis buku) di tahun 2022 berbeda dengan dirinya di tahun 1992 dan 1982 karena yang tetap sama adalah kebenaran dalam hubungannya dengan Roh Kudus, dengan Yesus dan dengan Allah Bapa. \r\n\r\n<b>Daftar isi:</b> \r\n- Title page\r\n- Dedication\r\n- Epigraph\r\n- Contents\r\n- Introduction\r\n- Rescue\r\n- Purpose\r\n- Restoration\r\n- Perseverance\r\n- Healing\r\n- Acknowledgement\r\n- Notes\r\n- Index\r\n- For Moments When You Need a Prayer\r\n- About the Author\r\n- Also by Harris Faulkner\r\n- Copyright\r\n- About the Publisher', 'Kehidupan Doa, pertumbuhan rohani, penguatan iman', 'masyarakat umum', NULL, 'Baik', 'Diterima', NULL, NULL, 'ce64659a0f3a4847aa5376ce7ea44afd', NULL, '2023-02-21 08:54:38', NULL),
('a9f45fe568ed405ca0e2b1801a5c2b3c', 'd4808bfeebd34159ac0a862930a0c420', 'Cukup', 'Cukup', 'ffcca04ba0894989b011c72ecf70591e', 'pendahuluan: penulis mengajak pembaca untuk merenungkan apakah hidupnya akan menuju finishing well. kata \"finishing well\" biasanya digunakan dalam konteks kedukaan / berhasil menyelesaikan suatu pekerjaan (pensiun dari pekerjaan). Secara garis besar isi buku bersifat kompilasi dari berbagai sumber yang memberikan motivasi untuk pembaca bisa finishing well. Tokoh yang dimasukkan dalam buku sebagian besar adalah tokoh sekuler & menyebutkan merk bisnis diantaranya Mixue sebagai contoh.\r\n\r\nbuku ditulis dalam paragraf pendek, masing-masing terdiri 3-4 kalimat.\r\n\r\nURGENT\r\nBuku ini dari ex-direktur Andi Offset.', 'self improvement, inspirasi kristiani', 'masyarakat umum kristiani', NULL, 'Cukup', 'Diterima', NULL, NULL, 'ce64659a0f3a4847aa5376ce7ea44afd', NULL, '2023-02-21 08:25:16', NULL),
