('d0ce1e6a4e2849de80894a9e08daa662', 'eab5719f886c40d28e7c6badf3d82105', 'Cukup', 'Cukup', '1598193526f34779babe8c6746fc73d9', 'Public Relation atau sering disebut Humas dirasa sangat perlu kehadirannya, karena Humas menjadi tombak suatu Instansi atau lembaga dalam menjalin relasi dengan pihak luar (eksternal) dan terutama dengan pihak dalam perusahaan (Internal). Tujuan dari penulisan buku ajar ini tidak lain adalah untuk membantu para akademisi dan praktisi di dalam memahami seperti apa panduan di dalam ruang lingkup implementasi Public Relation/ Hubungan Masyarakat di media online.', 'mhs hubungan internasional atau mhs public relation', 'mhs hubungan internasional atau mhs public relation', NULL, 'Cukup', 'Diterima', 'jurusan hubungan internasional atau public relation', NULL, '78f2c15288884a22b2a192196eaa513f', NULL, '2023-02-02 06:29:35', NULL),
