('f4db1780c8674293813e41af1e419b50', '2b494b597e4f4124a8dc68e1a62b998f', 'Baik', 'Baik', 'ffcca04ba0894989b011c72ecf70591e', 'Buku ini bicara tentang orang-orang yang hidupnya cenderung menyenangkan orang lain sehingga membuat dirinya frustasi. Dengan membuat batasan yang sehat dalam hubungan/berelasi akan membantu dirinya untuk tidak kehilangan jati dirinya tanpa rasa bersalah dan dirinya tetap bisa mengasihi orang lain. Berikut ini hal-hal yang dibagikan dalam buku ini:\r\n?	Memahami 5 hal dalam menerapkan batasan yang sehat \r\n?	Menentukan kemampuan diri dan memahami emosi orang saat berhubungan dengan seseorang \r\n?	Berhenti disesatkan dan emosi yang dikendalikan oleh pemikiran yang keliru yang menjadikan dinamika berhubungan menjadi tidak sehat.\r\n?	Mengatasi pikiran yang frustasi akibat pembuatan batasan yang tidak realistis dan berlatih membuat strategi yang membantu dalam berkomunikasi, bertahan dan menerapkan pola yang lebih sehat.\r\n?	Jangan ragu untuk mengatakan ‘selamat tinggal’ tanpa rasa bersalah ketika hubungan yang sulit menjadi kacau dan tidak dapat dipertahankan\r\n\r\nDaftar Isi:\r\nIntroduction: We Can’t Set Good Boundaries Without Love\r\nChapter 1: You Are Not Crazy (You can love them, but you can’t change them)\r\nChapter 2: Naming the Tension What We’ve All Been Wrestling With\r\nChapter 3: It’s Not About the Problems, It’s About What the Problems Represent\r\nChapter 4: God Takes Boundary Violations Very Seriously and So Should We\r\nChapter 5: You Are Already Doing This Really Well\r\nChapter 6: They May Never See Your Boundaries as a Good Thing\r\nChapter 7: Just Because They Say It Doesn’t Mean You Have to Own It\r\nChapter 8: Trying to Make Someone Else Happy Shoudn’t Be Your Definition of Healthy\r\nChapter 9: What Am I So Afraid Of?\r\nChapter 10: Can a Goodbye Ever Really Be Good?\r\nChapter 11: I’m Not Walking Away, I’m Accepting Reality\r\nChapter 12: A Million Little Funerals\r\nConclusion: A Bible, a Ring, and a God Who Never Leaves Us\r\nWisdom to Turn to When Our Boundaries Are Called into Question\r\nGetting the Help You Need\r\nSome Important Notes to Consider on Abuse\r\nAcknowledgements\r\nNotes\r\nAbout The Author', NULL, 'masyarakat umum', NULL, 'Baik', 'Diterima', NULL, NULL, 'ce64659a0f3a4847aa5376ce7ea44afd', NULL, '2023-02-21 09:09:20', NULL),
